import React from "react";
import Navbar1 from "../Navbar1";
import Footer from "../Footer";
import Order1component from "../Order1component";
import Order2component from "../Order2component";

const Order = () => {
    return (
        <div>
            <Navbar1/>
            <Order1component/>
            <Order2component/>
            <Footer/>
        </div>
       
    )

}
export default Order
